public int hashCode() {
  final int prime = 31;
  int result = 1;
  result =
      prime * result + ((getNodeId() == null) ? 0 : getNodeId().hashCode());
  result =
      prime * result + ((getToken() == null) ? 0 : getToken().hashCode());
  return result;
}
